import { Link } from 'react-router-dom';
function Header (){
    return (
        <div className="header">
<div className="header__logo"></div>

<Link className="header__link" to="sign-up">
          Регистрация
        </Link>
      {/* ) : ( */}
        <Link className="header__link" to="sign-in">
          Войти
        </Link>
        </div>
    );
}

export default Header;
